/**
 *  Max character in string
 */

function findMaxChar(str) {
  str = str.toLowerCase();
  let obj = {};
  let maxChar = '';
  let maxCount = 0;

  for (char of str) {
    if (obj[char] === undefined) {
      obj[char] = 1;
    } else {
      obj[char] += 1;
    }
  }

  for (char in obj) {
    if (obj[char] > maxCount) {
      maxCount = obj[char];
      maxChar = char;
    }
  }

  console.log(maxCount, maxChar);
}

